import React, { Component } from 'react';

class Callout extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    const { showContact } = this.props;
    return (
        <div className="dtc v-mid tc white ph3 ph4-l">
          <h1 className="f1 f2-m fw1 tc" >ristolina</h1>
          <h2 className="fw1 f3 white-80 mt3 mb4">a page about me</h2>
          <a className="f6 no-underline grow dib v-mid white-70 ba ph3 pv2 mb3" href="mailto:" >Email me</a>
          { showContact ? <a href="mailto:" className="f6 no-underline grow dib v-mid white-70 ba ph3 pv2 mb3">hello@email.com</a> : ''}

        </div>
    );
  }
}

export default Callout;
